description:
包含一些常用的操作类，大都是静态类，加密解密，反射操作，硬件信息，文档转换，字符串扩展方法，日期时间扩展操作，大文件拷贝，图像裁剪，验证码、NoSql等常用封装。

示例代码：

1.将Word文档转换为html

DocumentConvert.Doc2Html(@"D:\test.doc", @"D:\test\");

2.检验字符串是否是Email

bool isEmail="1170397736@qq.com".MatchEmail();

3.获取CPU核心数

int core = SystemInfo.GetCpuCount();

4.大文件操作

FileStream fs = new FileStream(@"D:\boot.vmdk", FileMode.OpenOrCreate, FileAccess.ReadWrite);

{

//fs.CopyToFile(@"D:\1.bak");//同步复制大文件

fs.CopyToFileAsync(@"D:\1.bak");//异步复制大文件

string md5 = fs.GetFileMD5Async().Result;//异步获取文件的MD5

}

......

